import React from 'react';
import './styles.css';

function App() {
  return (
    <div className="homepage">
      <div className="overlay">
        <h1 className="title">Oncolink</h1>
        <div className="description-box">
          <p>
            Oncolink is a precision oncology platform using AI to provide diagnostics, enable communication, and assist in personalized meal planning for cancer patients.
          </p>
        </div>
        <div className="button-container">
          <button className="nav-button" onClick={() => window.location.href = "/diagnostic"}>AI Diagnostic</button>
          <button className="nav-button" onClick={() => window.location.href = "/communications"}>Communications</button>
          <button className="nav-button" onClick={() => window.location.href = "/meal-planner"}>Meal Planner</button>
        </div>
      </div>
    </div>
  );
}

export default App;
